eval("__webpack_require__.r(__webpack_exports__);\n/* harmony default export */ __webpack_exports__[\"default\"] = (\"Different attacks, damaging spells, and other harmful effects deal different types of damage. Damage types have no rules of their own, but other rules, such as damage resistance, rely on the types. The damage types follow, with examples to help a GM assign a damage type to a new effect.\\n\\n**Acid**: The corrosive spray of a black dragonâ€™s breath and the dissolving enzymes secreted by a black pudding deal acid damage.\\n\\n**Bludgeoning**: Blunt force attacksâ€”hammers, falling, constriction, and the likeâ€”deal bludgeoning damage.\\n\\n**Cold**: The infernal chill radiating from an ice devilâ€™s spear and the frigid blast of a white dragonâ€™s breath deal cold damage.\\n\\n**Fire**: Red dragons breathe fire, and many spells conjure flames to deal fire damage.\\n\\n**Force**: Force is pure magical energy focused into a damaging form. Most effects that deal force damage are spells, including magic missile and spiritual weapon.\\n\\n**Lightning**: A lightning bolt spell and a blue dragonâ€™s breath deal lightning damage.\\n\\n**Necrotic**: Necrotic damage, dealt by certain undead and a spell such as chill touch, withers matter and even the soul.\\n\\n**Piercing**: Puncturing and impaling attacks, including spears and monstersâ€™ bites, deal piercing damage.\\n\\n**Poison**: Venomous stings and the toxic gas of a green dragonâ€™s breath deal poison damage.\\n\\n**Psychic**: Mental abilities such as a psionic blast deal psychic damage.\\n\\n**Radiant**: Radiant damage, dealt by a clericâ€™s flame strike spell or an angelâ€™s smiting weapon, sears the flesh like fire and overloads the spirit with power.\\n\\n**Slashing**: Swords, axes, and monstersâ€™ claws deal slashing damage.\\n\\n**Thunder**: A concussive burst of sound, such as the effect of the thunderwave spell, deals thunder damage.\\n\");\n\n//# sourceURL=webpack:///./src/content/combat/damage-and-healing/damage-types.md?");

